      // Update configuration
      await this.updateConfiguration(config);

      // Restart services
      await this.restartServices(config);

      step.status = 'success';
      step.endTime = Date.now();
    } catch (error) {
      step.status = 'failed';
      step.error = error instanceof Error ? error.message : String(error);
      step.endTime = Date.now();
      throw error;
